        <div class=""txt_on_main"" style=""color:#fff; margin-top:20px"">
            <p><strong>Итальянская мебель</strong> уже несколько столетий является эталоном совершенства и показателем статуса владельцев. Она делает любой, даже самый скромный дом уютным, а интерьер – стильным. Роскошные элитные изделия сегодня предлагают многие магазины в Москве. Однако, для того, чтобы быть уверенным в аутентичности и безукоризненном качестве продукции, приобретать её стоит только у официальных дилеров ведущих производителей Италии. <strong>Компания «Мебель Италии»</strong> предлагает купить в своём салоне, а также в интернет-магазине великолепную мебель, изготовленную на лучших итальянских мебельных фабриках, с которыми нас связывает многолетнее успешное сотрудничество.</p>
            <h2>Наш ассортимент</h2>
            <p>В каталоге нашей компании представлены потрясающие коллекции от Angel");
            WriteLiteral(@"o Cappellini, Egidio Lunardelli, Cassina, Ditre Italia и других известных брендов. Мы предлагаем:</p>
            <ul>
                <li>Стенки, диваны и кресла для гостиной;</li>
                <li>Гарнитуры для детской комнаты, кухни, прихожей и спальни;</li>
                <li>Столы и шкафы для кабинета.</li>
            </ul>
            <p>К приобретённой обстановке, изготовленной в замечательных исторических традициях мастеров-краснодеревщиков, в нашем салоне можно подобрать выполненные в том же стиле аксессуары, великолепные предметы декора и разнообразные светильники (напольные, настенные, настольные, потолочные).</p>
            <h2>Отличительные особенности мебели из Италии</h2>
            <p>Среди многочисленной аналогичной продукции <strong>изделия итальянских мастеров</strong> выделяются такими преимуществами, как:</p>
            <ul>
                <li>
                    Изумительный дизайн, имеются гарнитуры, выполненные в духе:
                    <ul>
                   ");
            WriteLiteral(@"     <li>Аристократичной классики;</li>
                        <li>Утончённого модерна;</li>
                        <li>Затейливого рококо;</li>
                        <li>Колоритного кантри;</li>
                        <li>Лаконичных современных стилей;</li>
                    </ul>
                </li>
                <li>Разнообразие цветов – от самых светлых до тёмных, преимущественно натуральных оттенков;</li>
                <li>Изысканность инкрустации и декора, а на некоторых предметах и <strong>ручной орнаментальной росписи</strong>;</li>
                <li>Надёжность механизмов, гарантирующая безотказную работу в течение длительного времени;</li>
                <li>Безопасность для здоровья человека, обеспеченная использованием только экологически чистых, натуральных материалов.</li>
            </ul>
            <p>Все эти качества по достоинству оценили покупатели, многие из которых стали постоянными клиентами нашего интернет-магазина.</p>
            <h2>Условия оформления за");
            WriteLiteral(@"каза</h2>
            <p>Выбрать обстановку для дома можно в онлайн-каталоге, размещённом на нашем сайте. Несколько фото, прикреплённых к товарной карточке каждого изделия, позволяют детально рассмотреть каждый <strong>предмет гарнитура</strong>.</p>
            <p>Затем нужно:</p>
            <ul>
                <li>Добавить продукцию в корзину.</li>
                <li>Заполнить несложную форму.</li>
